Error types are meaningful and well-behaved (C-GOOD-ERR) Error 类型 是 Result<T, E> 中的 E 类型，在你的 crate 中 Result<T, E> 是被公共 (public) 函数返回的。 Error 类型 总是应该实现 std::error::Error trait ： 在错误处理库中用这个 trait 来对不同类型的错误进行抽象（比如 error-chain crate ）； 也可以使用这个 trait 的 [.source()] 方法来得到更底层的错误。 此外，Error 类型 应该实现 Send 和 Sync trait 。 不具备 Send 的 Error 类型 不能被 thread::spawn 运行的线程返回； 不具备 Sync 的 Error 类型 不能在不同的线程间使用 Arc 来传递。 这些在多线程应用软件中处理基础错误时是常见且必须的。 Send 和 Sync 在使用 std::io::Error::new 进行自定义 IO 错误时扮演了重要角色， 因为这里传入的 Error 类型 需要实现 Error + Send + Sync trait 。 在返回 Error trait 对象的函数里，需要对这条原则保持审慎。 比如 reqwest::Error::get_ref 函数。 通常 Error + Send + Sync + 'static 组合适合对大多数调用场景。 附加的 'static 能利用 Error::downcast_ref 方法来获取 Error trait 对象 。 不要把 () 作为 Error 类型 ，即便对于一个不带有帮助性的额外信息的错误， 也不要让这个错误是 () 类型 。 () 没有实现 Error ，所以它无法和 error-chain 这样的错误处理库一起使用。 () 没有实现 Display ，所以使用者无法打印自己写的错误信息。 () 实现了 Debug ，但是当使用者 unwrap 错误的时候，它没提供任何有用的东西。 对于实现了 From<()> 的 Error 类型的下游库 ，() 在语义上是毫无意义的， 从而无法使用 ? 操作符。 需要做的是，针对你的 crate 或者单个函数来定义有实际意义的 Error 类型 。 给合适的 Error 类型 实现 Error 和 Display trait 。 对于无实际意义的错误，利用 unit 结构体来实现 Error 和 Display trait 。 use std::error::Error;
use std::fmt::Display; // Instead of this...
fn do_the_thing() -> Result<Wow, ()> // Prefer this...
fn do_the_thing() -> Result<Wow, DoError> #[derive(Debug)]
struct DoError; impl Display for DoError { /* ... */ }
impl Error for DoError { /* ... */ } Error 类型 实现的 Display trait 通常应该提供简明的错误信息 (error messages)， 而且信息用全小写，末尾不带标点符号。 不应该实现 Error::description() trait ，因为它已经被弃用。 而应该实现 Display trait 来打印错误 [1] 。 来自标准库的例子： ParseBoolError ：从字符串解析 bool 值时返回这个错误。 一些错误信息的例子： "unexpected end of file" "provided string was not `true` or `false`" "invalid IP address syntax" "second time provided was later than self" "invalid UTF-8 sequence of {} bytes from index {}" "environment variable was not valid unicode: {:?}" 译者注： ToString 给所有具有 Display trait 的类型自动实现了 .to_string() 方法，从而获得错误信息的字符串。

